import React from "react";
import styled from "styled-components";

const DivContainer = styled.div`
  position: absolute;
  width: 100%;
  bottom: 0;
  background: inherit;
`;

export default function Footer() {
  return (
    <DivContainer>
      <h3>Made remotely by Stark Lab, inc. Copyright 2022 (clone simaskova)</h3>
    </DivContainer>
  );
}
